import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <form>
        <label>
          Nome:
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Enviar" />
      </form>
    </div>
  );
}

export default App;
